INSERT INTO `template_criteria` VALUES (27,6,NULL,'Student Engagement','Measures how well the teacher engages students in learning',1.00,0,0,'2025-08-27 13:53:02'),(28,7,NULL,'Vocabulary Understanding','Student demonstrates understanding of key vocabulary',1.50,0,0,'2025-08-27 13:53:29'),(29,7,NULL,'Text Analysis','Student can analyze text structure and meaning',2.00,0,0,'2025-08-27 13:53:29'),(30,6,NULL,'Student Engagement','Measures how well the teacher engages students in learning',1.00,0,0,'2025-08-27 19:43:59'),(31,7,NULL,'Text Analysis','Student can analyze text structure and meaning',2.00,0,0,'2025-08-27 19:44:04'),(32,7,NULL,'Vocabulary Understanding','Student demonstrates understanding of key vocabulary',1.50,0,0,'2025-08-27 19:44:04'),(33,6,NULL,'Student Engagement','Measures how well the teacher engages students in learning',1.00,0,0,'2025-08-27 19:44:28'),(34,7,NULL,'Text Analysis','Student can analyze text structure and meaning',2.00,0,0,'2025-08-27 19:46:04'),(35,7,NULL,'Vocabulary Understanding','Student demonstrates understanding of key vocabulary',1.50,0,0,'2025-08-27 19:46:04'),(36,7,NULL,'Text Analysis','Student can analyze text structure and meaning',50.00,0,0,'2025-08-28 05:31:46'),(37,7,NULL,'Vocabulary Understanding','Student demonstrates understanding of key vocabulary',50.00,0,0,'2025-08-28 05:31:46'),(38,6,NULL,'Student Engagement','Measures how well the teacher engages students in learning',1.00,0,0,'2025-08-28 11:32:59'),(39,6,NULL,'Student Participation','Evaluate student engagement and active participation in class discussions',33.33,0,0,'2025-08-28 19:59:54'),(40,6,NULL,'Interactive Activities','Assess the effectiveness of interactive classroom activities and exercises',33.33,0,0,'2025-08-28 19:59:54'),(41,6,NULL,'Classroom Energy','Measure the overall energy and enthusiasm maintained throughout the lesson',33.34,0,0,'2025-08-28 19:59:54'),(42,6,NULL,'Classroom Energy','Measure the overall energy and enthusiasm maintained throughout the lesson',40.00,0,0,'2025-08-28 21:01:50'),(43,6,NULL,'Interactive Activities','Assess the effectiveness of interactive classroom activities and exercises',30.00,0,0,'2025-08-28 21:01:50'),(44,6,NULL,'Student Participation','Evaluate student engagement and active participation in class discussions',30.00,0,0,'2025-08-28 21:01:50'),(45,11,NULL,'Cold Call - Frequency','Analyze the transcript for Cold Call frequency. Look for instances where the teacher calls on students by name without them raising their hands. Count total cold calls and evaluate if they meet the target of 8-12 per 45-minute lesson. Consider: How many times does the teacher use unexpected questioning? Are students consistently prepared to respond? Provide specific examples with approximate timestamps if available.',2.00,0,1,'2025-08-28 22:24:46'),(46,11,NULL,'Cold Call - Distribution','Examine how Cold Call questions are distributed among students. Identify different student voices/names called upon and calculate what percentage of the class participated. Target: 60%+ of students called at least once. Look for evidence of: Equitable participation, avoidance of calling only on eager volunteers, systematic inclusion of all learners.',2.00,0,2,'2025-08-28 22:24:46'),(47,11,NULL,'Cold Call - Timing','Evaluate the timing pattern of Cold Calls throughout the lesson. Are they spread evenly or clustered in certain sections? Look for: Cold calls in opening, middle, and closing of lesson. Consistent engagement expectations maintained throughout. Evidence that teacher uses Cold Call as ongoing engagement strategy, not just occasionally.',1.50,0,3,'2025-08-28 22:24:46'),(48,11,NULL,'Cold Call - Effectiveness','Assess student response quality and success rate to Cold Calls. Target: 90%+ receive substantive answers. Analyze: How often students provide meaningful responses when called unexpectedly. Evidence of a culture where students are prepared to participate. Student confidence and engagement when called upon without warning.',2.00,0,4,'2025-08-28 22:24:46'),(49,11,NULL,'Wait Time - Average Duration','Measure the pause duration between teacher questions and calling on students or accepting responses. Target: 3-5 seconds average. Count instances of adequate wait time (3+ seconds) vs rushed questions (<2 seconds). Look for evidence that teacher allows sufficient processing time for thoughtful responses.',2.00,0,5,'2025-08-28 22:24:46'),(50,11,NULL,'Wait Time - Consistency','Analyze consistency of wait time across different questions. Target: 80%+ of questions receive minimum 3-second wait time. Look for: Sustained commitment to thinking time, avoiding the tendency to fill silence quickly, evidence that teacher values student thinking over rapid responses.',2.00,0,6,'2025-08-28 22:24:46'),(51,11,NULL,'Wait Time - Question Complexity Matching','Evaluate whether wait time is appropriately adjusted based on question complexity. Complex questions should receive longer wait times (5-8 seconds). Look for: Strategic thinking about questioning depth, appropriate patience for higher-order thinking questions, differentiated wait time based on cognitive demand.',1.50,0,7,'2025-08-28 22:24:46'),(52,11,NULL,'No Opt Out - Resolution Rate','Identify instances where students say \"I don\'t know\" or give incorrect answers, then track teacher follow-through. Target: 95%+ resolution rate. Look for: Teacher persistence in helping students reach correct answers, use of scaffolding or hints, returning to original student after getting help from others, maintaining high expectations for all learners.',2.50,0,8,'2025-08-28 22:24:46'),(53,11,NULL,'No Opt Out - Method Variety','Analyze the variety of support strategies used when students opt out. Target: 3+ different approaches (hints, simpler questions, peer help, think-pair-share, etc.). Look for: Adaptive teaching skills, creative problem-solving, differentiated support methods, teacher flexibility in helping struggling students succeed.',1.50,0,9,'2025-08-28 22:24:46'),(54,11,NULL,'No Opt Out - Follow Through','Track whether teacher returns to original student with correct answer after getting help from others. This ensures the struggling student ultimately achieves success rather than avoidance. Look for: Complete follow-through on No Opt Out, student confidence building, accountability maintained for original student.',2.00,0,10,'2025-08-28 22:24:46'),(55,11,NULL,'No Opt Out - Time Investment','Evaluate time investment in resolving opt-out situations. Target: 45-90 seconds per resolution. Assess: Balance between supporting struggling students and maintaining lesson pacing, efficient use of support strategies, evidence that teacher values both individual success and group progress.',1.00,0,11,'2025-08-28 22:24:46'),(56,11,NULL,'Right is Right - Precision Requests','Look for instances where teacher pushes for more precise, complete, or accurate answers rather than accepting \"close enough\" responses. Target: 70%+ of imprecise answers receive precision requests. Evidence: \"Not quite,\" \"Can you be more specific?\" \"Use the exact terminology,\" maintaining high academic standards consistently.',2.00,0,12,'2025-08-28 22:24:46'),(57,11,NULL,'Right is Right - Standard Consistency','Evaluate whether high accuracy standards are maintained throughout the entire lesson without fatigue or compromise. Look for: Consistent expectations from start to finish, no lowering of standards as lesson progresses, sustained commitment to excellence despite time pressure or student resistance.',2.00,0,13,'2025-08-28 22:24:46'),(58,11,NULL,'Right is Right - Student Growth Evidence','Identify evidence that students internalize high expectations and begin self-correcting by lesson end. Look for: Students catching their own mistakes, increasing precision in language without prompting, evidence that students understand and adopt the teacher\'s high standards.',1.50,0,14,'2025-08-28 22:24:46'),(59,11,NULL,'Right is Right - Missed Opportunities','Count instances where partially correct answers are accepted without pushback for greater precision. These represent missed opportunities to reinforce high standards. Look for: Times when teacher could have pushed for more accuracy, moments when \"good enough\" was accepted instead of excellence.',1.50,0,15,'2025-08-28 22:24:46'),(60,11,NULL,'Format Matters - Complete Sentences','Analyze student responses for complete sentence structure. Target: 80%+ of responses in proper format. Count responses like \"Yeah\" or \"Because...\" vs complete sentences. Look for: Teacher requests for complete sentences, evidence that students understand academic language expectations, improvement in student language quality.',2.00,0,16,'2025-08-28 22:24:46'),(61,11,NULL,'Format Matters - Academic Vocabulary','Track usage of subject-specific academic vocabulary by students. Target: 5+ academic terms per 10-minute segment. Identify: Subject-specific terminology, elevated language choices, evidence that students are developing scholarly discourse patterns appropriate to the discipline.',1.50,0,17,'2025-08-28 22:24:46'),(62,11,NULL,'Format Matters - Format Interventions','Count teacher interventions requesting better language format. Look for phrases like: \"Can you say that in a complete sentence?\" \"Use our academic vocabulary,\" \"Try that again with precise language.\" Evidence of commitment to elevating student communication standards.',1.50,0,18,'2025-08-28 22:24:46'),(63,11,NULL,'Format Matters - Language Progression','Compare language quality from lesson start to end. Target: 15% improvement in format quality. Look for: Students adapting to higher expectations during lesson, evidence of responsive teaching as language standards are reinforced, progression toward academic discourse.',1.00,0,19,'2025-08-28 22:24:46'),(64,10,NULL,'Cold Call - Frequency','Analyze the transcript for Cold Call frequency. Look for instances where the teacher calls on students by name without them raising their hands. Count total cold calls and evaluate if they meet the target of 8-12 per 45-minute lesson. Consider: How many times does the teacher use unexpected questioning? Are students consistently prepared to respond? Provide specific examples with approximate timestamps if available.',1.50,0,1,'2025-08-28 22:24:46'),(65,10,NULL,'Cold Call - Distribution','Examine how Cold Call questions are distributed among students. Identify different student voices/names called upon and calculate what percentage of the class participated. Target: 60%+ of students called at least once. Look for evidence of: Equitable participation, avoidance of calling only on eager volunteers, systematic inclusion of all learners.',1.50,0,2,'2025-08-28 22:24:46'),(66,10,NULL,'Cold Call - Timing','Evaluate the timing pattern of Cold Calls throughout the lesson. Are they spread evenly or clustered in certain sections? Look for: Cold calls in opening, middle, and closing of lesson. Consistent engagement expectations maintained throughout. Evidence that teacher uses Cold Call as ongoing engagement strategy, not just occasionally.',1.00,0,3,'2025-08-28 22:24:46'),(67,10,NULL,'Cold Call - Effectiveness','Assess student response quality and success rate to Cold Calls. Target: 90%+ receive substantive answers. Analyze: How often students provide meaningful responses when called unexpectedly. Evidence of a culture where students are prepared to participate. Student confidence and engagement when called upon without warning.',1.50,0,4,'2025-08-28 22:24:46'),(68,10,NULL,'Wait Time - Average Duration','Measure the pause duration between teacher questions and calling on students or accepting responses. Target: 3-5 seconds average. Count instances of adequate wait time (3+ seconds) vs rushed questions (<2 seconds). Look for evidence that teacher allows sufficient processing time for thoughtful responses.',1.50,0,5,'2025-08-28 22:24:46'),(69,10,NULL,'Wait Time - Consistency','Analyze consistency of wait time across different questions. Target: 80%+ of questions receive minimum 3-second wait time. Look for: Sustained commitment to thinking time, avoiding the tendency to fill silence quickly, evidence that teacher values student thinking over rapid responses.',1.50,0,6,'2025-08-28 22:24:46'),(70,10,NULL,'Wait Time - Question Complexity Matching','Evaluate whether wait time is appropriately adjusted based on question complexity. Complex questions should receive longer wait times (5-8 seconds). Look for: Strategic thinking about questioning depth, appropriate patience for higher-order thinking questions, differentiated wait time based on cognitive demand.',1.00,0,7,'2025-08-28 22:24:46'),(71,10,NULL,'No Opt Out - Resolution Rate','Identify instances where students say \"I don\'t know\" or give incorrect answers, then track teacher follow-through. Target: 95%+ resolution rate. Look for: Teacher persistence in helping students reach correct answers, use of scaffolding or hints, returning to original student after getting help from others, maintaining high expectations for all learners.',2.00,0,8,'2025-08-28 22:24:46'),(72,10,NULL,'No Opt Out - Method Variety','Analyze the variety of support strategies used when students opt out. Target: 3+ different approaches (hints, simpler questions, peer help, think-pair-share, etc.). Look for: Adaptive teaching skills, creative problem-solving, differentiated support methods, teacher flexibility in helping struggling students succeed.',1.00,0,9,'2025-08-28 22:24:46'),(73,10,NULL,'No Opt Out - Follow Through','Track whether teacher returns to original student with correct answer after getting help from others. This ensures the struggling student ultimately achieves success rather than avoidance. Look for: Complete follow-through on No Opt Out, student confidence building, accountability maintained for original student.',1.50,0,10,'2025-08-28 22:24:46'),(74,10,NULL,'Right is Right - Precision Requests','Look for instances w