. Look for phrases like: \"Can you say that in a complete sentence?\" \"Use our academic vocabulary,\" \"Try that again with precise language.\" Evidence of commitment to elevating student communication standards.',1.00,0,16,'2025-08-28 22:24:46'),(80,10,NULL,'Stretch It - Follow-up Frequency','Identify follow-up questions after correct student answers. Target: 50%+ of correct answers receive extension questions. Look for: \"Why do you think that?\" \"How do you know?\" \"What makes you certain?\" \"Can you give another example?\" Evidence that teacher builds on student success to deepen thinking rather than simply accepting correct responses.',2.00,0,17,'2025-08-28 22:24:46'),(81,10,NULL,'Stretch It - Question Depth','Evaluate the intellectual depth of extension questions. Analyze: Surface vs deep thinking prompts, questions that require analysis/synthesis/evaluation, connections to broader concepts, questions that challenge students to explain their reasoning and demonstrate deeper understanding.',2.00,0,18,'2025-08-28 22:24:46'),(82,10,NULL,'Stretch It - Student Engagement','Assess quality of student responses to stretch questions. Target: Average 2+ sentences in extended responses. Look for: Evidence of deeper thinking activation, sophisticated reasoning, student willingness to engage with challenging follow-ups, improvement in response quality when pushed to extend thinking.',1.50,0,19,'2025-08-28 22:24:46'),(83,10,NULL,'Stretch It - Missed Opportunities','Count instances where correct answers were accepted without intellectual extension. These represent missed opportunities for deeper learning. Look for: Times when teacher could have pushed thinking further, moments when students showed readiness for intellectual challenge that wasn\'t pursued.',1.00,0,20,'2025-08-28 22:24:46'),(84,10,NULL,'CFU - Check Frequency','Count comprehension checks during new content delivery. Target: Understanding check every 5-7 minutes of new material. Look for: \"Who can explain t